Considerando o atual cenário de violência urbana no Estado do Rio de Janeiro, com recorrentes ocorrências de hostilidade contra agentes e viaturas militares,
especialmente em áreas de risco elevado, a Marinha do Brasil vem a requerer a troca da placa oficial do veículo supracitado por placa comum (padrão Mercosul),
com o objetivo de garantir:
1. Segurança do efetivo militar em missões administrativas, logísticas e operacionais que não demandam ostensividade;
2. Preservação da integridade do material bélico e patrimonial da União, evitando identificação antecipada do veículo por facções ou indivíduos armados;
3. Discrição e proteção da missão institucional, nos termos do artigo 144 da Constituição Federal, que assegura a preservação da ordem pública;
4. Redução do risco de emboscadas, atentados ou represálias a militares que transitam por áreas dominadas por organizações criminosas.
